import React from "react";
import { image } from "faker";

class ImageList extends React.Component {
  render() {
    let imageList;
    this.props.images.map((img) => {
      imageList.push(<img src={image.urls.regular} />);
    });
    return <div>{imageList}</div>;
  }
}

export default ImageList;
